import React, { useState } from 'react';
import { motion } from 'framer-motion';
import { Link } from 'react-router-dom';
import LoginForm from '../components/auth/LoginForm';
import RegisterForm from '../components/auth/RegisterForm';

const Auth = ({ type = 'login' }) => {
  const [activeTab, setActiveTab] = useState(type);

  return (
    <div className="min-h-screen py-12 bg-primary/5 flex items-center justify-center">
      <div className="w-full max-w-4xl mx-auto">
        <div className="bg-white rounded-lg shadow-lg overflow-hidden">
          <div className="flex flex-col md:flex-row">
            {/* Left Side - Image and Info */}
            <div className="md:w-1/2 bg-primary p-8 text-white">
              <motion.div
                initial={{ opacity: 0 }}
                animate={{ opacity: 1 }}
                transition={{ duration: 0.5 }}
              >
                <h2 className="text-3xl font-bold mb-6">
                  {activeTab === 'login' ? 'Xoş Gəlmisiniz!' : 'Bizimlə Başlayın!'}
                </h2>
                <p className="mb-8">
                  {activeTab === 'login' 
                    ? 'AutiSense platformasına giriş edərək hesabınıza daxil olun və övladınızın inkişafına dəstək olun.' 
                    : 'Qeydiyyatdan keçərək AutiSense-in bütün funksionallıqlarına tam giriş əldə edin və övladınızın tərəqqisini izləyin.'}
                </p>

                <div className="hidden md:block">
                  <div className="bg-white/10 rounded-lg p-6">
                    <h3 className="font-semibold mb-4">AutiSense ilə əldə edəcəkləriniz:</h3>
                    <ul className="space-y-3">
                      <li className="flex items-center">
                        <svg className="h-5 w-5 mr-3" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                          <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M5 13l4 4L19 7" />
                        </svg>
                        Fərdiləşdirilmiş öyrənmə təcrübəsi
                      </li>
                      <li className="flex items-center">
                        <svg className="h-5 w-5 mr-3" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                          <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M5 13l4 4L19 7" />
                        </svg>
                        AI dəstəkli analizlər
                      </li>
                      <li className="flex items-center">
                        <svg className="h-5 w-5 mr-3" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                          <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M5 13l4 4L19 7" />
                        </svg>
                        Peşəkar mütəxəssislərlə əlaqə
                      </li>
                    </ul>
                  </div>
                </div>
              </motion.div>
            </div>

            {/* Right Side - Forms */}
            <div className="md:w-1/2 p-8">
              <div className="mb-8 flex">
                <button
                  onClick={() => setActiveTab('login')}
                  className={`flex-1 py-3 border-b-2 font-medium text-center ${
                    activeTab === 'login' 
                      ? 'border-primary text-primary' 
                      : 'border-transparent text-gray-500 hover:text-gray-700'
                  }`}
                >
                  Giriş
                </button>
                <button
                  onClick={() => setActiveTab('register')}
                  className={`flex-1 py-3 border-b-2 font-medium text-center ${
                    activeTab === 'register' 
                      ? 'border-primary text-primary' 
                      : 'border-transparent text-gray-500 hover:text-gray-700'
                  }`}
                >
                  Qeydiyyat
                </button>
              </div>

              <motion.div
                key={activeTab}
                initial={{ opacity: 0, x: activeTab === 'login' ? -20 : 20 }}
                animate={{ opacity: 1, x: 0 }}
                transition={{ duration: 0.3 }}
              >
                {activeTab === 'login' ? <LoginForm /> : <RegisterForm />}
              </motion.div>

              <div className="mt-8 text-center text-gray-600 text-sm">
                <p>
                  {activeTab === 'login'
                    ? 'Hesabınız yoxdur? '
                    : 'Artıq hesabınız var? '}
                  <button
                    onClick={() => setActiveTab(activeTab === 'login' ? 'register' : 'login')}
                    className="text-primary font-medium hover:underline"
                  >
                    {activeTab === 'login' ? 'Qeydiyyatdan keç' : 'Giriş et'}
                  </button>
                </p>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Auth;
